INSERT INTO `p_konfigurasi_seo` (`id`, `kode`, `slug`, `hash_id`, `author`, `description`, `keyword`, `title`, `copyright`, `publisher`, `robots`, `url`, `logo`, `is_deleted`, `created_at`, `created_by`, `modified_at`, `modified_by`) VALUES
(1, 'WAN/KS/00001', 'konfigurasi-seo-8912931', 'J62Voiq3hmA3fktyZ+9POtXum0qESmJc/V50HhqeL/I=', 'Rizki Karianata', 'Winnow Anplag adalah sebuah aplikasi anti-plagiarisme yang dibangun dengan menggunakan algoritma winnowing. Aplikasi ini dirancang khusus untuk membantu para pengajar dan peneliti dalam memeriksa keaslian dokumen atau karya ilmiah yang dibuat oleh mahasiswa atau orang lain. Dengan menggunakan teknologi algoritma winnowing, Winnow Anplag dapat mendeteksi kemiripan dokumen dengan cara membandingkan pola-pola kata kunci yang terdapat pada dokumen tersebut. Dalam pengembangannya, Winnow Anplag juga dilengkapi dengan fitur-fitur pendukung seperti pembanding dokumen, analisis tingkat kemiripan, dan laporan hasil deteksi plagiarisme yang dapat diunduh oleh pengguna. Dengan fitur-fitur tersebut, Winnow Anplag menjadi salah satu solusi yang efektif dalam meminimalkan tindakan plagiat pada dunia pendidikan dan penelitian.', 'winnow anplag,jasaweb,gonata indonesia,website kamu', 'Winnow Anplag - Aplikasi Anti-Plagiarisme Menggunakan Algoritma Winnowing', 'Winnow Anplag 2023', 'Winnow Anplag', 'index, follow', 'http://localhost/winnow-anplag', '1b8f50eca0a81813c5a4b837ac475f5fe1c3a15b.png', 0, '2023-04-20 08:57:14', 1, '2023-04-20 08:57:14', 1);
